import styles from '../css/AboutSection.module.css';

export function AboutSection() {
    return (
        <div className={styles.AboutSection}>
            <div className={styles.SectionTitle}>About me</div>
            <div className={styles.SectionText}>About me</div>
        </div>
    )
}
